-- Create numbers table - 100k
DECLARE @NumOfInserts INT;
SET @NumOfInserts = 100000;

DROP TABLE IF EXISTS ##numtable

;WITH cteNum AS (
	SELECT 1 num
	UNION ALL
	SELECT num+ 1 AS num
	FROM cteNum 
	WHERE num < @NumOfInserts
)
SELECT num 
	INTO ##numtable 
FROM cteNum OPTION (maxrecursion 0)

CREATE CLUSTERED INDEX ix_num  
    ON ##numtable (num);   

