--
-- Createnumbers table with 102400 or 1048576 records
DECLARE @NumOfInserts INT;
SET @NumOfInserts = 102400;
--SET @NumOfInserts = 1048576;

DROP TABLE IF EXISTS ##numtable
;WITH cteNum AS (
	SELECT 1 num
	UNION ALL
	SELECT num+ 1 AS num
	FROM cteNum 
	WHERE num < @NumOfInserts
)
SELECT num 
	INTO ##numtable 
FROM cteNum OPTION (maxrecursion 0)

CREATE CLUSTERED INDEX ix_num  
    ON ##numtable (num);

